import React from 'react'
import PostItem from './PostItem';
import AddPost from './AddPost';

function Posts() {
  return (
    <div className="posts">
        <div className="post-head">
            Post
        </div>
        <div className="post-add">
            <AddPost />
        </div>
        <div className="post-field">
            <PostItem />
        </div>
    </div>
  )
}

export default Posts
